import UtilsButton from "../Utils/UtilsButton";

const AddTodo = () => {
  return (
    <div>
      <div className="add-todo-container">
        <input type="text" required autoFocus placeholder="New Todo" />
        <button
          label="Add new task"
          fontColor="white"
          width={300}
          backgroundColor="blue"
        ></button>
      </div>
    </div>
  );
};

export default AddTodo;
